//该文件专门用于创建整个应用的路由器
import VueRouter from 'vue-router'
//引入组件
import PassWord from '../pages/PassWord.vue'
import Yanz from '../pages/Yanz.vue'

//创建并暴露一个路由器
export default new VueRouter({
    routes:[
        {
            path:"/passWord",
            component:PassWord
        },
        {
            path:"/yanz",
            component:Yanz,
        }
    ]
})
